FBI Agent Will Graham (Hugh Dancy) hunts the most notorious serial killers. Graham is both gifted and cursed with an extraordinary ability: he can think like his prey, seeing what they see and feeling what they feel. What he doesn't know is that his new partner is the most notorious serial killer of all.
While pursuing an especially troubling, cannibalistic murderer, Special Agent Jack Crawford (Laurence Fishburne) teams Graham with a highly respected psychiatrist - a man with a taste for the criminally minded: Dr. Hannibal Lecter (Mads Mikkelsen).
Dr. Lecter tests Graham every step of the way, toying with him and playing a game all his own, while they work to unravel the mystery and catch the killer.
Like only Lecter can, he twists Graham's mind, daring him to question everything he knows about others...and himself.

